$.fn.donutRun=function(){var n=["white","green","choco","pink","blue","orange","yellow","purple","black"];$(this).on("click",function(){function o(){return Math.round(Math.random())-.8}for(var t=n.sort(o),r=0;r<t.length;r++){var a="<div class='donut'><div class='donut"+r+"'><img src='images/donut-"+t[r]+".png'>";$("body").append(a)}})};